alert(0)

const salary = document.querySelector(".city")
const state = document.querySelector(".state")
console.log(salary)

salary.addEventListener('change', (event) => {
    console.log(event.target.value)
    inss = Number(event.target.value) * 10
    state.textContent = inss 
})
